import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ResultsPage from "./components/ResultsPage";
// (Import other pages like PicksPage, etc.)

function App() {
  return (
    <Router>
      <Routes>
        {/* Add this route for /results */}
        <Route path="/results" element={<ResultsPage />} />

        {/* You probably also have other routes like these */}
        {/* <Route path="/" element={<HomePage />} /> */}
        {/* <Route path="/picks" element={<PlayerPicksPage />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
